export class UserExtension {
  constructor(id, address, phone, loggedIn, points, user) {
    this.id = id;
    this.address = address;
    this.phone = phone;
    this.loggedIn = loggedIn;
    this.points = points;
    this.user = user;
    this.loggedIn = this.loggedIn ?? false;
  }
}
export function getUserExtensionIdentifier(userExtension) {
  return userExtension.id;
}
